import './App.css';
import Person from './BasicInfo'

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      person: [
        {
          Name: "Jacqueline Kurien",
          Phone: "704-431-7200",
          DOB: "09/08/1997"
        },

      ]
    }
  }
  render(){
    return <Person person={this.state.person} />
  }
}



export default App;
